import React from "react";
import './Status.css';

const Status = () => {
    return(
        <div>
            <div class="statusBar">
                <div class="have">
                    보유금: 100 G
                </div>
                <div class="betting">
                    배팅금: 50 G
                </div>
            </div>
        </div>
    );
}

export default Status;
